 p_id=>20
,p_name=>'COTIZACION'
,p_alias=>'COTIZACION'
,p_page_mode=>'NON_MODAL'
,p_step_title=>'COTIZACION'
,p_autocomplete_on_off=>'OFF'
,p_page_template_options=>'#DEFAULT#'
,p_page_component_map=>'10'
,p_last_updated_by=>'ADMIN'
,p_last_upd_yyyymmddhh24miss=>'20221003131740'
);
wwv_flow_imp_page.create_page_plug(
 p_id=>wwv_flow_imp.id(28199639889221863)
,p_plug_name=>'COTIZACION'
,p_region_template_options=>'#DEFAULT#'
,p_component_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(26016857078473795)
,p_plug_display_sequence=>20
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Declare',
' subtotal number(9,2);',
' tdescuento number(7,2);',
' titbis number(7,2);',
' ttotal number(9,2);',
'Begin',
'htp.p(''<style> ',
'table { ',
'    font-family: arial, sans-serif;',
'    border: 0px;',
'    border-collapse: collapse;',
'    width: 80%;',
'}',
'.tdetail {',
'  ',
'  border: 1px solid black;',
'  border-collapse: collapse;',
'  width: 80%;',
'}',
'}',
'td {',
'    border: 0px solid #000001;',
'    text-align: left;',
'    padding: 2px;',
'}',
'th {',
'    font-weight: bold;',
'    border: 0px solid #000001;',
'    text-align: left;',
'    padding: 4px;',
'}',
'tr: {',
'   background-color: #dddddd; ',
'}',
'',
'</style>'');',
'',
'',
'',
'htp.p(''<table style="width: 100%; font-family: arial, sans-serif; font-size: 14;"><tr><th><font size="6" face="Courier New" >COTIZACION</font></th></tr><tr><td>&nbsp;</td></tr>',
'<tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>',
'<table style="width: 100%;"><tr><th style="background-color:red";>&nbsp;<th></tr></table>'');',
'--INFO COMPANIA',
' for c in (select nombre, direccion,to_char(sysdate,''DD/MM/YYYY'') fechah, ''(''||substr(telefono_id,1,3)||'')''||''-''||substr(telefono_id,4,3)||''-''||substr(telefono_id,7,4) telefonof,rnc,emailp from compania',
'            where id=:P0_CIA)',
' loop',
'            htp.p(''<table style="width: 70%"><tr>',
'                     <td>''||htf.escape_sc(c.nombre)||''</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.direccion)||''</td>',
'                     <td style="font-weight: bold;"> COTIZACION NO.</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.telefonof)||''</td>',
'                     <td style="font-weight: bold; font-size: 120%;"> HT''||lpad(to_char(htf.escape_sc(:P0_RCOTIZA)),6,''0000'')||''</td></tr>',
'                     <tr><td>RNC ''||htf.escape_sc(c.rnc)||''</td>',
'                     <td style="font-weight: bold;">''||htf.escape_sc(c.fechah)||''</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.emailp)||''</td></tr>',
'                     <tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>'');',
'',
' end loop;',
' --INFO CLIENTE, VEHICULO Y ORDEN',
' for o in (select id,producto_id,cliente_id from ordenes_reparacion',
'              where compania=:P0_CIA and id=:P0_RCOTIZA)',
' loop',
'   for c in (select nombre||'' ''||apellidos nombref,rnc_cedula rnc, direccion, ''(''||substr(telefonos,1,3)||'')''||''-''||substr(telefonos,4,3)||''-''||substr(telefonos,7,4) telefonof,nvl(email,''email'') email from clientes',
'              where compania=:P0_CIA and id=htf.escape_sc(o.cliente_id))',
'    loop',
'      for v in (select m.marca, o.descripcion modelo, c.descripcion color, to_char(p.anofab_prod,''9999'') anofab, p.referencia chasis ',
'             from productos p, marca_modelo m, modelos o, colores c',
'               where p.compania=:P0_CIA ',
'                 and p.id=htf.escape_sc(o.producto_id)                 ',
'                 and m.id=o.marcaid                 ',
'                 and o.id = p.modelo',
'                 and c.id = p.color)',
'',
'        loop',
'            htp.p(''<table><tr><th>COTIZAR A:</th><th>VEHICULO:</th>',
'                     <tr><td>''||htf.escape_sc(c.nombref)||''</td>',
'                     <td>''||htf.escape_sc(v.marca)||''</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.rnc)||''</td>',
'                     <td>''||htf.escape_sc(v.modelo)||''</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.direccion)||''</td>',
'                     <td>''||htf.escape_sc(v.color)||''</td></tr>',
'                     <tr><td>''||htf.escape_sc(c.telefonof)||''</td>',
'                     <td>''||htf.escape_sc(v.anofab)||''</td><tr>',
'                     <tr><td>''||htf.escape_sc(c.email)||''</td>',
'                     </tr><tr><td>&nbsp;</td></tr></table>'');',
'        end loop;',
'    end loop;',
' end loop;',
'',
'htp.p(''<table class="tdetail"><tr class="tdetail"><th style="background-color:#FFFFF0">DESCRIPCION</th><th style="text-align:center; background-color:#FFFFF0">CANTIDAD</th>',
'<th style="background-color:#FFFFF0">PRECIO</th><th style="background-color:#FFFFF0">TOTAL</th></tr>'');',
'subtotal:=0.00;',
'tdescuento:=0.00;',
'titbis:=0.00;',
'ttotal:=0.00;',
' for x in (select p.descripcion producto, de.cantidad cantidad, de.precio precio, to_char((de.cantidad*precio),''$999,999.00'') stotal ',
'            from sintomas s, diagnosticos d, ordenes_detalle de, productos p',
'              where s.orden_id=:P0_RCOTIZA',
'                and s.codigo > 0',
'                and d.sintomas_id = s.codigo',
'                and d.codigo > 0                ',
'                and de.diag_id = d.codigo',
'                and de.id > 0 ',
'                and p.id = de.producto_id)',
' loop',
' subtotal:=subtotal + (x.cantidad*x.precio);',
'htp.p(''<tr class="tdetail">',
'        <td>''||htf.escape_sc(x.producto)||''</td>',
'        <td style="text-align:center">''||htf.escape_sc(x.cantidad)||''</td>',
'        <td>''||htf.escape_sc(to_char(x.precio,''999,999.90''))||''</td>',
'        <td>''||htf.escape_sc(x.stotal)||''</td>',
'        </tr>'');',
'end loop;',
'    ',
'for imp in (select porciento from impuestos where compania = :P0_CIA and siglas=''ITBISV'')',
'  loop',
'    titbis:=((subtotal-tdescuento)*imp.porciento)/100;',
'  end loop;',
'  ttotal:=(subtotal-tdescuento) + titbis;',
'htp.p(''</table><table style="width: 80%">'');',
'htp.p(''<tr class="tdetail"><td colspan:"3">&nbsp;</td></tr>',
'        <tr><td style="text-align:right; font-weight: bold; colspan:"3">SUBTOTAL: ''||htf.escape_sc(to_char(subtotal,''$999,999,999.90''))||''</td></tr>',
'        <tr><td style="text-align:right"; font-weight: bold; colspan:"3">DESCUENTO: ''||htf.escape_sc(to_char(tdescuento,''$999,999.90''))||''</td></tr>',
'        <tr><td style="text-align:right; font-weight: bold; colspan:"3">ITBIS: ''||htf.escape_sc(to_char(titbis,''$999,999.90''))||''</td></tr>',
'        <tr><td style="text-align:right; font-size: 120%; font-weight: bold; colspan:"3">TOTAL: ***''||htf.escape_sc(to_char(ttotal,''$999,999.90''))||''***</td></tr>'');',
'htp.p(''</table>',
'<table style="width: 100%;"><tr>&nbsp;</tr></table>',
'<table style="width: 100%;"><tr><td style="text-align:center">GRACIAS POR PREFERIRNOS<td></tr></table>',
'<table style="width: 100%;"><tr><th style="background-color:red";>&nbsp;<th></tr></table>'');',
'htp.p(''<table style="width: 80%"><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>'');',
unistr('htp.p(''<table style="width: 80%;  font-size: 1;"><tr><td></td>Esta cotizaci\00F3n solo es v\00E1lida por 30 d\00EDas. HT AUTO PAINT 131927815 Santo Domingo Este, RD.</tr></table>'');'),
'end;'))
,p_plug_source_type=>'NATIVE_PLSQL'
);
end;
