'<button class="button button1" onclick="prtdiv();"><i class="fa fa-print"></i> Print</button>',
'<div id="div-print1" style="margin-top:2px;">',
'<style> ',
'table { ',
'    font-family: arial, sans-serif;',
'    border: 0px;',
'    border-collapse: collapse;',
'    width: 80%;',
'}',
'.tdetail {',
'  ',
'  border: 1px solid black;',
'  border-collapse: collapse;',
'  width: 80%;',
'}',
'}',
