'              where s.orden_id=:P0_RCOTIZA',
'                and s.codigo > 0',
'                and d.sintomas_id = s.codigo',
'                and d.codigo > 0                ',
'                and de.diag_id = d.codigo',
'                and de.id > 0 ',
'                and p.id = de.producto_id)',
' loop',
' ',
'htp.p(''<tr class="tdetail">',
