||'/td>',
'         <td width="20%"><a style="font-family: arial, sans-serif; font-size: 70%;">''||htf.escape_sc(to_char(z.horas,''999.90''))||''Hrs.</a></td>',
'         <td width="20%"><a style="font-family: arial, sans-serif; font-size: 70%;">RD$''||htf.escape_sc(to_char(z.valor,''9,999.90''))||''</a></td>',
'         <td width="20%"><a style="font-family: arial, sans-serif; font-weight: bold; font-size: 70%;">RD$''||to_char(mmonto,''999,999.90'')||''(''||htf.escape_sc(z.miestado)||'')&bull;</a>',
'         </td></tr></table></td></tr>'');',
'         mtotal:=mtotal+mmonto;',
'    end loop;    --htf.escape_sc(to_char(x.precio,''999,999.90''))',
'end loop;',
'htp.p(''<tr class="tdetail"><td colspan=2 style="text-align:right;"> TOTAL PAGO:RD$''||to_char(mtotal,''999,999.90'')||''</td>',
'</table><table style="width: 80%"><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>'');',
