'<th style="background-color:#FFFFF0;text-align:center;">TOTAL</th></tr></thead><tbody>'');',
'  subtotal:=0.00;',
'  tdescuento:=0.00;',
'  titbis:=0.00;',
'  ttotal:=0.00;',
'',
'for x in (select de.id codigo, p.id||''-''||p.descripcion producto,nvl(de.cantidad,0) dcantidad, nvl(de.precio,0) dprecio,',
