'htp.p(''<table style="width: 80%"><tr><td><div class="div2"><span class="signature">POR ''||micia||''</span></div></td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td><div class="div2"><span class="signature">Nombre y cedula/ sello del Cliente </span><'
||'/div></td></tr>',
'<tr><td><div class="div2"><span align="center">Entrega</span></div></td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td><div class="div2"><span class="centrado">Recibido</span></div></td></tr></table>'');',
