'htp.p(''<table style="width: 80%"><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>'');',
'htp.p(''<table style="width: 80%"><tr><td>&nbsp;</td></tr><tr><td>&nbsp;</td></tr></table>',
'<footer> ',
'<table><tr><td>''||micia||'' &nbsp;.-  <b>RNC:</b>''||ciarnc||''-. &nbsp; <b>Direcci&oacute;n:</b>''||ciadir||'' &nbsp;<b>www.koinos.com.do</b</tr></td></table>',
'</footer>',
'</div>'');',
'End;'))
